def counts_to_percents(counter):
    count_sum = sum(counter.values())
    percents = Counter()
    for k, v in counter.items():
        percents.update({round(k, 1): (v / count_sum) * 100})
    print(sum(percents.values()))
    return Counter({k: round(v) for k, v in percents.items()})


